import React from "react";
import Header from "./Header";
import Note from "./Note";
import NoteList from "./NoteList";
import Footer from "./Footer";
import './note.css';

const App = ()=>{
    const addNote = ()=>{
        alert('button clicked');
    }
    return <>
        <Header/>
        <Note
            passnote={addNote}
        />
        <NoteList/>
        <Footer/>
    </>
}

export default App;
